「エビス プライムパックスタッフ 絶品ごはん保存 お茶碗1杯分」は、あら熱をとらず、炊きたてのおいしさを保存できるごはん用冷凍保存容器です。2重構造で外気へ熱を伝えにくいので、あら熱をとらず炊き立てのごはんを冷凍保存できます。さらに、加熱時は重なった容器の空間を蒸気が通って水分を循環させ、ふっくら仕上げます。凸型底でムラなく加熱。フタ裏の突起に蒸気が集まり、水滴となって落ちることで、まんべんなくごはんに水分を行き渡らせます。<br><br>使用方法<br>(1)炊きたてのごはんを重ねた容器の内側にあるラインを目安にふんわり軽く入れ、すぐにフタを閉めて冷凍庫で保存します。<br>(2)加熱の際はフタを閉めたまま蒸気弁を開け、電子レンジで解凍・加熱します。<br>(3)加熱後はフタを取り、内容器をはずして茶碗に移します。<br>【解凍加熱時間の目安/容器1杯分(ごはん180g)】<br>●600W：3分30秒<br>●500W：4分<br>※700W以上では加熱しないでください。<br>※電子レンジの機種、ごはんの状態によって加熱時間が変わりますのであくまで目安として使用してください。<br>ご注意<br>【注意】<br>●加熱の際は必ず蒸気弁を開けてください。<br>【使用上の注意】<br>●使用前に「使用上の注意」をよく読み、使用中は捨てずに保管してください。<br>●完全密封ではないので、液もれしないよう水平に置いてください。<br>●本来の用途以外で使用しないでください。<br>●直火・オーブン・グリルで使用しないでください。<br>●冷凍庫から取り出した直後、衝撃を加えると割れる場合がありますので注意してください。<br>●冷凍後、蒸気弁がはずれにくい場合は水をかけてください。無理に引っぱったりひねったりすると、蒸気弁が折れる場合があります。<br>●火のそばに置かないでください。<br>●食器洗い機・食器乾燥機を使用する際は、取扱説明書に従って使用してください。<br>●購入後は洗浄してから使用してください。<br>【電子レンジで使用する際の注意】<br>●電子レンジの取扱説明書に従って使用してください。<br>●加熱後はヤケドをしないように十分注意してください。<br>●オート加熱・おまかせ加熱で使用しないでください。<br>●加熱後は蒸気弁を開けたままにしてください。<br>●オーブン機能が同時に働く電子レンジで使用しないでください。<br>●油分が多い食品(カレー・ミートソース・揚げ物等)や糖分の多い食品(ジャム等)は加熱しないでください。<br>●容器が変形・発煙・発火した場合はすぐに使用を中止してください。<br>●空焚きしないでください。<br>●水分の少ない食品や少量の食品を加熱する際は、加熱時間を短くしてください。<br>品質表示<br>●原料樹脂：ポリプロピレン<br>●耐熱温度：140度<br>●耐冷温度：-20度<br>●容量(内容器)：250ml<br>原産国<br>日本<br>お問い合わせ先<br><br>エビス株式会社<br>お客様フリーダイヤル：0120-37-0791<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
